script: |
  super -f text -I q4413.spq | sort > q4413.out

inputs:
  - name: q4413.spq
    data: |
      SELECT ALL - - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE 11 * col1 NOT BETWEEN + + col1 + - 5 AND + col0 / - CAST ( - - ( ( - col0 ) ) AS INTEGER ) + - - col2 + + - CAST ( NULL AS INTEGER );
  - name: tab1

outputs:
  - name: q4413.out
    data: |
